import { BrowserRouter as Router } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import InfoCards from "./components/InfoCards";

function App() {
  return (
    <Router>
      <Navbar />

      <Home />
      <InfoCards />
    </Router>
  );
}

export default App;
